(1, 18, '<div class="maincontent clearfix">\r\n	<div class="maincontent clearfix" id="MainContent">\r\n		<p>\r\n			　　新浪科技讯 北京时间5月18日凌晨消息，观察人士称，对冲基金Third Point CEO丹尼尔&middot;勒布(Daniel Loeb)在成为雅虎董事后将推进更加谨慎的策略，其中一方面就是专注于推进阿里巴巴(微博)集团的上市。</p>\r\n		<p>\r\n			　　由于Third Point在雅虎内部斗争中获胜，越来越多的推测称，雅虎新董事会将加速出售亚洲资产，特别是最有价值的阿里巴巴集团股份。但是其他观察人士称，勒布将会推行更加谨慎的策略，其中之一就是专注于阿里巴巴集团的上市。</p>\r\n		<p>\r\n			　　雅虎拥有阿里巴巴集团42%的股份，在发起代理权之争运动期间，Third Point就将阿里巴巴集团视为&ldquo;全球最有价值互联网公司之一&rdquo;，潜在估值在大约350亿美元。</p>\r\n		<p>\r\n			　　事实上，外界认为，包括雅虎日本股份在内的亚洲资产比雅虎核心业务更具价值，其核心业务市场现在被谷歌(微博)和Facebook等对手所统 治。雅虎和阿里巴巴之间的关系也曾经因为股份纠纷剑拔弩张，众所周知，阿里巴巴CEO马云(微博)希望拿回雅虎所持有的大部分股份，而不是全部。</p>\r\n		<p>\r\n			　　不过现在马云可以与勒布为代表的雅虎在会议会的谈判桌上讨论一下股份回购问题，但是雅虎投资人埃里克&middot;杰克逊(Eric Jackson)认为，雅虎不应该急于要阿里巴巴谈判。杰克逊此前支持过Third Point的代理权之争。</p>\r\n		<p>\r\n			　　&ldquo;出售阿里巴巴集团股份就像你拥有Facebook 40%股份，然后以300亿美元的估值全部卖掉，而Facebook现在的估值为1000亿美元，&rdquo;杰克逊称，&ldquo;这将是雅虎公司历史上最大错误。&rdquo;</p>\r\n		<p>\r\n			　　杰克逊提出了一项折中方案，那就是雅虎将部分股份出售给阿里巴巴，但需要马云给出明确的IPO(首次公开招股)时间表。&ldquo;你将会得到雅虎所持股份的确切估值，更重要的是，你将获得马云的IPO日期承诺。&rdquo;</p>\r\n		<p>\r\n			　　批发金融市场经纪公司BGC Partners分析师科林&middot;吉利斯(Colin Gillis)认为，杰克逊的方案可以解决双方的利益问题。&ldquo;雅虎将部分股份卖给阿里巴巴换取后者可能进行的IPO，这样一来，雅虎其实仍旧握有&lsquo;大量资产&rsquo;。&rdquo;</p>\r\n		<p>\r\n			　　市场分析机构海纳国际(Susquehanna)分析师赫曼&middot;粱(Herman Leung)表示：&ldquo;雅虎需要将部分股份卖回给马云，这样才能让后者决定在未来1年、2年或3年内选择上市。你必须让马云满足于获得充足的股份。&rdquo;</p>\r\n		<p>\r\n			　　其实马云此前就已经暗示过这种交易方案，他在去年6月发给员工的电邮中称：&ldquo;我们的利益与整个电子商务业界利益和日益增长的规模相一致，因此我们不能排除在未来让阿里巴巴集团上市的可能性，因为这是对支持并继续信任我们的员工和股东的回报。&rdquo;</p>\r\n		<p>\r\n			　　知情人士称，雅虎与阿里巴巴集团之间的谈判并未因为雅虎内部变化而破裂。雅虎、阿里巴巴尚未予以置评。(晓明)</p>\r\n	</div>\r\n</div>\r\n', '', '', '106.81.148.86'),
