(8, 18, '　央行5月12日晚间公告称，从2012年5月18日起，下调存款准备金率0.5个百分点。该消息将给股市带来什么影响?笔者在此梳理了一下专家及业内人士的主要观点，以飨读者。\r\n<p>\r\n	　　中国社会科学院金融研究所金融发展与金融制度研究室主任易宪容表示，此次再度下调存款准备金率意味着货币政策将保持适度宽松，对A股市场是一个利好。</p>\r\n<p>\r\n	　　中国著名经济学家华生表示，这次下调为今年来第2次下调，此次下调也是市场预料之中的，主要目的还是应对目前经济的乏力以及经济增速太慢，在被问及此消息对本周股指走势影响时，华生表示，这种宽松的货币政策消息对股指肯定是利好的。</p>\r\n<p>\r\n	　　中国政法大学资本研究中心主任刘纪鹏表示，证监会郭树清主席提振股市的一系列新政的思路大有来头，至少从现在起到年底，央行和证监会进入&ldquo;蜜月热恋&rdquo;期，将会联手振兴股市大力发展直接融资。存款准备金率在下半年下调三次是完全可能的。</p>\r\n<p>\r\n	　　不过，经济学家、财经评论员马光远认为，央行本次下调存款准备金率是对之前货币政策的一个纠偏。此次下调存准率主要针对实体经济，对股市影响几乎为零，心理层面的影响更多一些。</p>\r\n<p>\r\n	　　谈及对股市具体行业板块的影响，长城证券研究总监向威达表示，降低存款准备金率，银行股、地产股和周期股以及整个大盘应该能得到提振。但经济数据太差，市场因此持续大涨的可能性也不大。市场还会持续震荡比较长的时间。</p>\r\n<p>\r\n	　　英大证券研究所所长李大霄表示，央行降准为重大利好政策，有利于股市稳定。</p>\r\n', '', '', '14.107.101.207'),
(9, 18, '　又一家日本企业拿出了巨亏财报，电视业务拖累是原因之一。松下已经开始转型，它期望能在能源领域找到新的优势。\r\n<p>\r\n	　　这次是松下</p>\r\n<p>\r\n	　　文|CBN记者 邹曈</p>\r\n<p>\r\n	　　日本消费电子业正在集体与旧日荣光道别。先是索尼、夏普迎来了历史性巨亏，这一次又轮到了松下。</p>\r\n<p>\r\n	　　5月11日，松下宣布2011财年净亏损7721亿日元(约合610亿元人民币)，这是日本制造业史上第二大规模的亏损。亏损的一个重要原因是电视业务裁员费用以及收购三洋电机而计入的一次性支出，这些费用合计高达7671亿日元(约合606亿元人民币)。</p>\r\n<p>\r\n	　　另一方面，松下主营的电视、半导体、锂离子电池业务的低迷也拖累了公司。其中包含电视在内的AVC网络业务营业亏损达到678亿日元(约合54亿元人民币)，是所有业务中亏损最多的。</p>\r\n<p>\r\n	　　尴尬的2011财年是松下三年中期经营计划(Green Transformation 2012)的第二年。根据此计划，松下将转型为绿色能源企业，从以提供产品为中心变为以提供解决方案为中心，并加快全球化进展。</p>\r\n<p>\r\n	　　此前，津贺一宏已接替大坪文雄成为新任公司总裁，根据《朝日新闻》报道，津贺一宏是一位高尔夫爱好者，曾在加州大学进修电脑科技，长期以来致力于技术研发。津贺一宏原本担任松下电器高级主管以及视音频产品部门总裁。</p>\r\n<p>\r\n	　　2011年，大地震和泰国洪水迫使日本企业关停工厂产能，日元升值的压力继续，同时整个平板行业都在经历亏损，夏普为此不得不出售股份给鸿海。</p>\r\n<p>\r\n	　　同其他日本制造企业一样，松下采用了1990年代非常成功的垂直整合型生产模式，即自己研发、生产面板以及自己制造电视产品。这种模式的缺点在 于无法进一步降低价格。&ldquo;2006年和2008年我们先后在日本建立了等离子面板工厂和液晶面板工厂，现在看来，我们在电视业务上投资过度了。&rdquo;大坪文雄 说。截至2010财年，松下在电视业务的投入超过4000亿日元(约316亿人民币)。</p>\r\n<p>\r\n	　　而苹果、三星(微博)则采用了全球化供应链管理，将生产一部分或者大部分外包出去，将精力用于产品研发、设计上。根据市场咨询公司Asymco的数据，今年一季度，三星和苹果垄断了手机业99%的利润。</p>\r\n<p>\r\n	　　松下也意识到了这点，为此积极地进行业务调整。它把三洋的家电业务出售给了海尔，将锂离子电池的工厂迁至中国，并寻找合作伙伴一起研发下一代有机EL电视。</p>\r\n<p>\r\n	　　即便如此，松下还是一家拥有消费电子、元器件、解决方案三大事业群、九大主营业务、579家公司、33万员工的&ldquo;大象&rdquo;企业，快速转型并不容 易。它的目标是让绿色环保业务成为下一个最重要的战略核心，收购三洋电机的初衷就在于此。金融危机之后，松下已逐渐失去其在电视、家电领域的传统优势。</p>\r\n<p>\r\n	　　松下的转型或许会以日立公司为参照。日立公司曾创造日本制造业史上最大规模赤字(2008财年亏损7873亿日元)，它随后将资源集中在以可持续发展为前提的社会基础设施业务领域，成为了目前为数不多的盈利制造业日企之一。</p>\r\n<p>\r\n	　　日本的电子制造业</p>\r\n<p>\r\n	　　索尼</p>\r\n<p>\r\n	　　从2002年开始走入亏损泥潭(2007年有短暂盈利)，2011年亏损57.3亿美元。索尼正试图找回创新能力。</p>\r\n<p>\r\n	　　夏普</p>\r\n<p>\r\n	　　向鸿海转让10%的股份，2011年亏损46.6亿美元。</p>\r\n<p>\r\n	　　松下</p>\r\n<p>\r\n	　　已经失去在电视、家电领域的传统优势，松下的目标是转型为一家绿色能源企业。</p>\r\n<p>\r\n	　　日立</p>\r\n<p>\r\n	　　2011年销售额和净利润(部分来源于出售硬盘业务)分别增长3.8%和45%，公司的主营业务包括信息通信系统、高性能材料、社会产业系统等。</p>\r\n', '', '', '14.107.101.207'),
(10, 18, '<div class="maincontent clearfix">\r\n	<div class="maincontent clearfix" id="MainContent">\r\n		<p>\r\n			　　华为终端首款旗舰级轻薄双核智能手机Ascend P1，在4月18日首发当日即被抢购一空，引发了业内与媒体的高度关注。随后，该款机型在公开市场强势突破，短短10日内便覆盖苏宁等大型3C渠道、手机 专营店以及品牌专营店。截止至5月15日，华为Ascend P1已在500家Top零售店面完成铺货上柜，并在一线重点城市的30余家专营店销售告罄，出现一机难求的热销局面。</p>\r\n		<p>\r\n			　　华为Ascend P1的广受好评，源于其工业设计与硬件配置、应用体验的综合实力。早在CES展首次与大众见面时，华为Ascend P1就引起了媒体和数码发烧友的热力追捧。全球首发当日，伴随&ldquo;2999元&rdquo;这一极具竞争力的零售价格公布，消费者关注一度爆棚。Ascend P1定位于轻薄时尚的高端智能机，其核心产品优势在于&ldquo;极致&rdquo;惊艳的工业设计。7.69mm极致纤薄机身、64.8mm黄金宽度以及110g机身重量，为 用户带来极致舒适握感。同时华为Ascend P1采用了主频1.5GHz的德州仪器OMAP 4460处理器，在双核智能手机中运行速度最快。</p>\r\n		<p>\r\n			　　华为Ascend P1的热销，更多来源于精准的市场策略支撑。如今的高端智能机市场，苹果在华智能手机市场份额已经被挤出前三，HTC、索尼等智能手机厂商利润下滑，高端 市场出货量萎缩。华为终端瞄准契机，针对P1采用了高竞争性定价策略，速赢得了市场认同。其次，华为终端手机销售渠道同样进行了巨大变革：一改单一的运营 商定制渠道，全面拓展公开社会渠道，覆盖全国大型3C卖场，强化品牌专营店建设，并在电子商务渠道等销售业态上进行了创新尝试。快速而精准的渠道布局和产 品定价策略，使华为终端成功跻身全球顶级智能手机俱乐部。</p>\r\n		<p>\r\n			　　</p>\r\n		<div align="center">\r\n			<img alt="1" height="327" src="/uploads/allimg/130303/2204053913-0.jpg" width="493" /></div>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			　　无论是&ldquo;向情感致敬&rdquo;的工艺设计修养、还是手机智能时代的生活理念，华为Ascend P1都深刻代表着智能手机的消费趋势和发展方向。华为Ascend P1的热销将有助于推动顶级智能手机行业的洗牌，加速智能手机顶级厂商格局的调整。</p>\r\n	</div>\r\n</div>\r\n', '', '', '14.107.101.207'),
(29, 19, '<div class="maincontent clearfix">\r\n	<p>\r\n		　　在手机上输入银行网址，或下载某银行的客户端，联网上线，打开进入银行界面，登录自己的银行账户，就可以查询账户往来明细，进行各项金融个人业务&hellip;&hellip;这不就是手机银行么?</p>\r\n	<p>\r\n		　　是的，但这些仅仅是手机银行最基本的功能。事实上，手机银行除了可以转账汇款，缴费支付、黄金买卖、购彩续保、外汇交易等金融服务外，在生活消费方面也渐渐成熟起来，逛店买东西，尽享都市生活似乎已经是尽在&ldquo;掌&rdquo;握的一件事。</p>\r\n	<p>\r\n		<strong>　　方便更实用</strong></p>\r\n	<p>\r\n		　　建设银行(601939,股吧)是率先在国内推出手机银行服务的国有银行之一。经过多年的发展，建行手机银行已成为电子银行业务的亮点和拳头产品，在业务功能、客户覆盖范围、实用性和安全性等方面处于国内同业的先进水平。</p>\r\n	<p>\r\n		　　建行手机银行不但囊括了有形营业网点提供的基本金融服务，如查询明细、转账汇款、缴费支付、手机话费充值、信用卡、账户金、账户管理等，更有手 机股市、黄金买卖、国债买卖、外汇买卖、银证转账等紧跟市场动向的投资理财服务，还提供飞机订票、网点地图、影票在线、建行大智慧(601519,股 吧)、建行商城、个人存贷款计算器等便捷服务，便于客户随手掌控市场，时时积累财富。</p>\r\n	<p>\r\n		　　对于转账频繁的商务人群，用建行手机银行不但方便快捷，即转即到，省去存取现金的麻烦。如果对方也是建行手机银行客户，就可直接用&ldquo;手机到手机 的转账服务&rdquo;：只要输入对方的手机号码，系统就会显示对方的姓名、账号和信息，不用输入繁琐的账号，直接汇款即可。手机到手机转账支持同行异地转账，并且 可以免费向转账对象发送相应的短信提醒。即便对方没有开通建行手机银行，按照相应提示也可以收到汇款。</p>\r\n	<p>\r\n		　　&ldquo;手机银行约定账户转账功能&rdquo;是为有经常向固定客户群转账需求的客户提供的一项快捷服务。只需一次性设置收款人信息，建行手机银行就能依照您约定的时间和金额，向您指定的全国范围内建行及其它商业银行个人活期账户进行转账。</p>\r\n	<p>\r\n		　　通过手机股市，客户可以随时查询股市资讯、实时行情，还可办理股票的在线交易。</p>\r\n	<p>\r\n		　　此外建行手机银行还提供信用卡还款、缴费等服务，客户可随时缴纳电话费、水电煤气费等日常费用，还可为全国范围内的手机号码充值。</p>\r\n</div>\r\n', '', '', '127.0.0.1'),
(30, 19, '　5月17日讯(记者 梁沅 通讯员 刘芳 何亮)记者17日获悉，在&ldquo;三打两建&rdquo;专项行动中，龙岗区法院以假冒注册商标罪成功将一起涉案金额高达140万的假冒诺基亚注册商标案的幕后老板许某光追加起诉。\r\n<p>\r\n	　　据案情透露，被告人许某光在深圳市龙岗区坂田街道某工业区1栋3楼租用厂房，开设生产假冒诺基亚手机的无证工厂，并雇佣谢某多(已起诉)管理该 工厂，以牟取非法利益。2011年4月，警方接群众举报在该涉嫌生产假冒诺基亚手机窝点抓获谢某多，并现场查获涉嫌假冒诺基亚品牌手机及配件，涉案金额高 达140余万元人民币。被告人许某光闻讯后迅速逃往老家藏匿。</p>\r\n<p>\r\n	　　2011年6月，被告人谢某多假冒注册商标一案移送至龙岗区院审查起诉时，办案检察官经过认真仔细的阅卷，发现被告人许某光作为工厂的老板、出 资人及总销售人员，在本案中的作用至关重要，检察官遂要求公安机关抓捕被告人许某光，并在开展&ldquo;三打两建&rdquo;专项行动时跟踪监督。2012年3月，许某光在 家乡被公安机关抓获归案。</p>\r\n<p>\r\n	　　被告人许某光等人假冒诺基亚注册商标的行为，严重扰乱了健康有序的市场运行秩序，也阻碍了社会信用体系的建设。此案的成功追诉，反映了检察官对案件高度负责的工作态度，更表明了检察机关充分履行检察职能，严厉打击制假售假犯罪行为，服务经济建设的坚定决心。</p>\r\n', '', '', '127.0.0.1'),
(31, 19, '<p>\r\n	　　昨今儿一早，小张就收到好友的一条短信：&ldquo;兄弟，我在星巴克附近上网，有个好东东给你介绍，试了好用记得请我吃饭。赶紧下载移动的 EasyWLAN客户端。你有全球通套餐，可以免费使用到年底。&rdquo;后面还有一条，&ldquo;免费客户端下载：手机点击 http://easy.g3quay.net/easywlan/ 或上网搜索&lsquo;EasyWLAN&rsquo;。&rdquo;这是什么业务呢?怀着好奇的心里，小张上网查询了相关内容。</p>\r\n<p align="left">\r\n	　　来自中国移动的相关信息显示，该业务是中国移动从客户的实际需求出发，结合为民服务创先争优活动推出的一项新举措。 Easy WLAN手机客户端是中国移动为方便用户查找并快速连接CMCC WLAN而定制的软件，提供CMCC热点提醒、快速认证服务，并可智能检测CMCC热点，当产生上网流量时，提醒用户或自动登陆CMCC WLAN，该项目是中国移动在广东试点研发的。</p>\r\n　　经过测试体验，小张发现，这项业务有几个特点。一是即时提醒热点。当手机智能扫描发现热点后，通过白色或灰色集团随e行WLAN标识，立刻提醒 客户有WLAN信号覆盖;登陆成功后，显示为橙色集团随e行WLAN标识。二是当手机有上网行为时，客户端将自动打开手机WLAN功能，客户可自主选择是 否连接CMCC，链接模式支持自动连接、提示连接和手动连接等多种;15分钟不使用则自动关闭WLAN。三是对WLAN硬件常开过于耗电的问题，该客户端 通过智能算法大幅降低耗电，实现WLAN扫描耗电增量不超过电池总量5%。四是首次配置完毕后，客户端可保存用户名与密码，缩短认证步骤，实现快速登录。', '', '', '127.0.0.1'),
