(100, 66, '<span style="font-size:26px;">河南省商开智能科技股份有限是一家专业从事高低压开关设备、智能无功补偿电容器、智能配电终端及系统集成设备等；集贸易、技术、服务于一体的系统集成、产品销售、工程服务的高新技术企业。 公司集全国知名电力智能化专家技术实力于一身，以引领电力智能化产业技术为己任，推动我国电力智能化事业的快速发展。企业拥有多项自主知识产权和专利技术，多年来的生产经验、雄厚的技术力量，高素质的员工队伍，确保产品质量稳定、安全。公司自成立以来，一直坚持以客户为中心，以诚信对待每位客户。我公司的产品以其良好的性能质量、完善的售后服务，得到了用户的一致好评，在汽车、食品、纺织机械、化工、电力、建筑、水利、煤焦化工、污水处理、 电厂水厂、印刷等行业中建立了良好的信誉。 公司将秉承&quot;诚信、专业、发展、共赢&quot;的经营理念，&ldquo;服务、创新、团结、务实&rdquo;的经营宗旨。不断开拓新市场、承接新业务，公司以先进的科学技术为龙头，严密的企业管理为依托，为客户提供严谨而周密的服务，树立公司良好的企业形象和打造公司优良的服务品牌。热忱欢迎国内外各界朋友和新老客户莅临指导、洽谈合作。</span><img alt="" src="/uploads/allimg/180427/1-1P42G01KL11.jpg" style="font-size: 26px; width: 344px; height: 344px;" />', '', '', '180.169.86.235');
