(73, 38, 'Polyester needle felt filter bag is a bag dust collector in the main filter, using nonwoven needle punched process, fine fiber cloth polyester staple fiber carding and lapping are arranged in staggered, fiber gap distribution on a needle felting. The material strength, elastic recovery performance is good, the fabric dimensional stability, good wear resistance, large void ratio, good air permeability, long service life, good dust removing effect, normal temperature (below 130 DEG C) under the mechanical properties and resistance to acid and alkali of good. Because the polyester low price, so polyester needle felt filter medium low temperature is the most cost-effective.<br />\r\nPolyester needle felt filter bag according to the characteristics of different manufacturers to dust, often mixed with antistatic fiber, singeing, calendering, water and oil repellent impregnation treatment, polyester felt made in the original performance and increase the easy cleaning (dust peeling fast), water and oil repellent (anti condensation), antistatic performance, formed a series of products.\r\n<table border="0" cellpadding="1" cellspacing="1" style="color: rgb(51, 51, 51); line-height: 24px; font-family: 宋体; background-color: rgb(252, 252, 252);" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align: center; font-family: Arial, Helvetica, sans-serif;">\r\n				<img alt="涤纶针刺毡滤袋" src="/uploads/allimg/140423/1-1404231P410Y6.jpg" style="margin: 0px; padding: 0px; border: currentColor; width: 300px; height: 225px;" /></td>\r\n			<td style="text-align: center; font-family: Arial, Helvetica, sans-serif;">\r\n				<img alt="涤纶针刺毡滤袋" src="/uploads/allimg/140423/1-1404231P430393.jpg" style="margin: 0px; padding: 0px; border: currentColor; width: 300px; height: 225px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align: center; font-family: Arial, Helvetica, sans-serif;">\r\n				涤纶针刺毡滤袋--01</td>\r\n			<td style="text-align: center; font-family: Arial, Helvetica, san