(74, 38, 'Waterproof and oil proof dust bag is acupuncture, the hydrophobic and oleophobic agent by padding, pre drying, baking processing formed<br />\r\nWaterproof and oil proof dust bag is acupuncture, the hydrophobic and oleophobic agent by padding, pre drying, baking processing formed. Hydrophobic and oleophobic agent by fast drying, surface as a mesh bag attached to the filter fiber, so as to reduce the surface tension, water and oil and filter bag so that water wet filter media, the formation of oil and dust will not adhere on the surface of dust filter bag, thus avoiding the paste bag phenomenon<br />\r\nWaterproof and oil proof dust bag is usually lower than the dew point temperature in the precipitator box temperature, the use of dust containing gas humidity of the larger.<br />\r\nUnder normal circumstances, if the dust gas acidity is very small, the dew point temperature of 40 to 60 DEG C if the acidity, the dew point temperature could be as high as 120 ℃<br />\r\nWaterproof and oil proof dust bag production process is as follows: fiber opening, carding, Web - pre - the main thorn thorn -- -- -- -- felt singeing calendering impregnated PTFE (waterproof agent) - drying - shaped - rolling - roll.<br />\r\nWaterproof and oil proof dust bag filter bag with waterproof oil processing in the humidity big situation, compared with ordinary bag, because the filter is not easy to be blocked paste bag, the bag and prolong the service life and the cleaning cycle can be prolonged, gas flow through the have also increased, so it can be a lot of saving energy consumption and maintenance costs.<br />\r\n<table border="0" cellpadding="1" cellspacing="1" style="color: rgb(51, 51, 51); line-height: 24px; font-family: 宋体; background-color: rgb(252, 252, 252);" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align: center; font-family: Arial, Helvetica, sans-serif;">\r\n				<img alt="防水防油除尘布袋" src="/uploads/allimg/140423/1-1404231KP12V.jpg" style="margin: 0px; paddi