(76, 38, 'High temperature dust bag has the characteristics of high temperature resistance, high strength, acid and alkali resistance, corrosion resistance, bending etc..<br />\r\nHigh temperature dust bag has the characteristics of high temperature resistance, high strength, acid and alkali resistance, corrosion resistance, anti bending, chemically treated with different surface finishing technology, also has the advantages of easy cleaning, water and oil repellent, anti-static characteristics; high-temperature dust bag and a series of products suitable for 150-200 ℃, 200-250 ℃ 250-300 ℃, different temperature section.<br />\r\nHigh temperature dust bag compared with glass fiber filter, its wear resistance, bending resistance and peel strength are significantly improved, can bear high load of filtration. The filtration speed of up to 1.0m/min, low operation resistance. High temperature resistant filter bag and synthetic temperature resistant, chemical fiber filter overcomes the large elongation, deformation, low temperature resistance, corrosion resistance and weakness; dimensional stability, strength is better, and the price is lower than other high temperature resistant chemical fiber.<br />\r\nHigh temperature dust bag with a special common felt cloth high porosity, good air permeability, has the advantages of high dust collection efficiency, long service life, because of high temperature dust bag of moderate temperature rating, up to 150 &deg; C; acid, alkalinity medium and with very good abrasion resistance, into a variety for the use of felt class of filters in quantity, surface treatment of high temperature dust bag according to the different requirements of industrial and mining conditions of singeing and calendering or coating.\r\n<table border="0" cellpadding="1" cellspacing="1" style="color: rgb(51, 51, 51); line-height: 24px; font-family: 宋体; background-color: rgb(252, 252, 252);" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align: center; 