(82, 39, '<div>\r\n	Dust filter bag skeleton is ribs, characterized as light, convenient installation and maintenance, quality directly affects the dust skeleton state and the service life of filter bag.</div>\r\n<div>\r\n	Dust skeleton in the actual operation in accordance with the usage and the principle of normal use, ensure the important effect and value in the actual situation the effect of ash, not by a certain factor, can produce a good performance and value in a complex environment. Bag dust collector during operation of the cleaning cycle and cleaning time, always observe the pressure differential system, so as to judge whether problems. Must record the normal operation of the differential pressure value, such as the pressure increased, may mean that the filter bag dust blockage, harden, failure, ash cleaning mechanism of ash accumulation and other phenomena. And reduce the pressure difference, may mean that the bag breakage, loss, entrance side pipe plug or valve closed, leakage phenomenon between box or compartment.<br />\r\n	<br />\r\n	&nbsp;</div>\r\n<table border="0" cellpadding="1" cellspacing="1" style="color: rgb(51, 51, 51); line-height: 24px; font-family: 宋体; background-color: rgb(252, 252, 252);" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align: center; font-family: Arial, Helvetica, sans-serif;">\r\n				<img alt="除尘骨架" src="/uploads/allimg/140423/1-140423232514341.jpg" style="margin: 0px; padding: 0px; border: currentColor; width: 300px; height: 225px;" /></td>\r\n			<td style="text-align: center; font-family: Arial, Helvetica, sans-serif;">\r\n				<img alt="除尘骨架" src="/uploads/allimg/140423/1-1404232325302T.jpg" style="margin: 0px; padding: 0px; border: currentColor; width: 300px; height: 225px;" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align: center; font-family: Arial, Helvetica, sans-serif;">\r\n				除尘骨架--01</td>\r\n			<td style="text-align: center; font-family: Arial, Helvetica, sans-serif;">\r\n				除尘骨架--02</td>\r\