INSERT INTO `dede_addonsoft` (`aid`, `typeid`, `filetype`, `language`, `softtype`, `accredit`, `os`, `softrank`, `officialUrl`, `officialDemo`, `softsize`, `softlinks`, `introduce`, `daccess`, `needmoney`, `templet`, `userip`, `redirecturl`) VALUES
(11, 21, '.exe', '简体中文', '国产软件', '共享软件', 'Win2003,WinXP,Win2000,Win9X', 3, 'http://', 'http://', '0.02 MB', '{dede:link islocal=''1'' text=''本地下载''} /uploads/soft/201252315915.jpg {/dede:link}\r\n', '<div class="maincontent clearfix">\r\n	<div class="maincontent clearfix" id="MainContent">\r\n		<p>\r\n			　　新浪科技讯 5月18日消息，知情人士透露，中国电信(微博)将在6月牵头进行今年以来规模最大的一次CDMA手机采购，预计将采购手机上千万部，且以智能手机为主，这将对下半年的中国电信3G手机供应将产生重要影响。</p>\r\n		<p>\r\n			<strong>　　6月举行今年最大规模CDMA终端采购</strong></p>\r\n		<p>\r\n			　　主要的手机厂商和手机国代商均证实，已得到通知，中国电信要求各厂商和经销商在下个月的广州交易会上统一采购手机，并且一些在当地有实力的省包商、手机连锁企业也均在邀请之列。</p>\r\n		<p>\r\n			　　自2009年起，中国电信的手机交易会已连续举行了三届，新浪科技目睹了前面几届的所有历程。2009年时，中国电信在南京召开首届交易会 时，CDMA厂商还只有几十家，但此后仅在2009年就增加了上百家手机企业，2010年，CDMA终端产业链厂商又达到200多家，参加天翼手机交易会 的有7000人，而2011年增加到上万人。</p>\r\n		<p>\r\n			　　根据已报名情况，CDMA终端厂商、设计公司、应用开发商、芯片厂家、终端经销商等加起来就有5000多家。中国电信预计将有数万人参加交易会。</p>\r\n		<p>\r\n			　　据悉，本次会议将决定中国电信下半年的终端政策走向，也将对CDMA手机厂商的业绩具有相当影响。</p>\r\n		<p>\r\n			<strong>　　预计将采购智能手机1000多万部</strong></p>\r\n		<p>\r\n			　　每届的天翼手机交易会都会采购3G手机，以前是几百万部，但今年情形已完全不一样，这主要是因为市场规模的壮大。</p>\r\n		<p>\r\n			　　2011年，天翼终端市场规模总量达到创纪录的6000万部，增长超过40%，天翼3G手机全年销量达3400万部，比2010年增长3倍以 上，天翼智能手机超过1660万部，比2010年增长10倍以上。而今年3月份，中国电信CDMA用户增长350万户，其中3G用户增长240万户，总数 达4355万户，3G 用户连续九个月单月净增用户超过200万。</p>\r\n		<p>\r\n			　　截至2012年3月底，中国电信CDMA用户总数接近1.36亿户，其中3G用户增至4355万户。此次中国电信将联合国代商采购大量天翼3G手机，预计将达1000多万部，是2009年的数倍，此次采购的天翼3G手机是下半年中国电信的主力机型。</p>\r\n		<p>\r\n			　　最新的消息是，目前天翼手机月销量中3G手机占比已经超过70%，智能手机占比超过47%。。</p>\r\n	</div>\r\n</div>\r\n', 0, 0, '', '14.107.101.207', ''),
(12, 21, '.exe', '简体中文', '国产软件', '共享软件', 'Win2003,WinXP,Win2000,Win9X', 3, 'http://', 'http://', '0.02 MB', '{dede:link islocal=''1'' text=''本地下载''} /uploads/soft/201252315915.jpg {/dede:link}\r\n', '<p>\r\n	　　新浪科技讯 5月18日消息，知情人士透露，中国电信(微博)将在6月牵头进行今年以来规模最大的一次CDMA手机采购，预计将采购手机上千万部，且以智能手机为主，这将对下半年的中国电信3G手机供应将产生重要影响。</p>\r\n<p>\r\n	<strong>　　6月举行今年最大规模CDMA终端采购</strong></p>\r\n<p>\r\n	　　主要的手机厂商和手机国代商均证实，已得到通知，中国电信要求各厂商和经销商在下个月的广州交易会上统一采购手机，并且一些在当地有实力的省包商、手机连锁企业也均在邀请之列。</p>\r\n<p>\r\n	　　自2009年起，中国电信的手机交易会已连续举行了三届，新浪科技目睹了前面几届的所有历程。2009年时，中国电信在南京召开首届交易会 时，CDMA厂商还只有几十家，但此后仅在2009年就增加了上百家手机企业，2010年，CDMA终端产业链厂商又达到200多家，参加天翼手机交易会 的有7000人，而2011年增加到上万人。</p>\r\n<p>\r\n	　　根据已报名情况，CDMA终端厂商、设计公司、应用开发商、芯片厂家、终端经销商等加起来就有5000多家。中国电信预计将有数万人参加交易会。</p>\r\n<p>\r\n	　　据悉，本次会议将决定中国电信下半年的终端政策走向，也将对CDMA手机厂商的业绩具有相当影响。</p>\r\n<p>\r\n	<strong>　　预计将采购智能手机1000多万部</strong></p>\r\n<p>\r\n	　　每届的天翼手机交易会都会采购3G手机，以前是几百万部，但今年情形已完全不一样，这主要是因为市场规模的壮大。</p>\r\n<p>\r\n	　　2011年，天翼终端市场规模总量达到创纪录的6000万部，增长超过40%，天翼3G手机全年销量达3400万部，比2010年增长3倍以 上，天翼智能手机超过1660万部，比2010年增长10倍以上。而今年3月份，中国电信CDMA用户增长350万户，其中3G用户增长240万户，总数 达4355万户，3G 用户连续九个月单月净增用户超过200万。</p>\r\n<p>\r\n	　　截至2012年3月底，中国电信CDMA用户总数接近1.36亿户，其中3G用户增至4355万户。此次中国电信将联合国代商采购大量天翼3G手机，预计将达1000多万部，是2009年的数倍，此次采购的天翼3G手机是下半年中国电信的主力机型。</p>\r\n　　最新的消息是，目前天翼手机月销量中3G手机占比已经超过70%，智能手机占比超过47%。', 0, 0, '', '127.0.0.1', ''),
(13, 21, '.exe', '简体中文', '国产软件', '共享软件', 'Win2003,WinXP,Win2000,Win9X', 3, 'http://', 'http://', '0.03 MB', '{dede:link islocal=''1'' text=''本地下载''} /uploads/soft/201252315829.jpg {/dede:link}\r\n', '<p>\r\n	　　今年的 &ldquo;5.17&rdquo;世界电信日，中国三大运营商使出的招数，除了资费价格战外，就是定制终端智能机的争夺。尤其是在近期炒得火热的 &ldquo;千元智能机&rdquo;市场，中国移动(微博)，中国联通(微博)，中国电信三家运营商卯足了劲吸引用户。</p>\r\n<p>\r\n	　　运营商争夺&ldquo;千元智能机&rdquo;市场的背后是对终端用户的把握。在移动互联网时代，如果不占据用户资源，运营商无疑再次面临&ldquo;管道化&rdquo;的危机。</p>\r\n<p>\r\n	　　对运营商们来说，目前的机会在于，传统概念中被认为&ldquo;低端&rdquo;的千元智能机市场可能由于新的合作伙伴不断加入而发生变化。此前，千元智能机市场被 华为、中兴、酷派、联想等国内厂商牢牢占据，随后三星、HTC、诺基亚等国际品牌也开始推出千元智能机，以期获得更大的发展。</p>\r\n<p>\r\n	　　运营商高补贴下注&ldquo;千元智能机&rdquo;</p>\r\n<p>\r\n	　　&ldquo;5&middot;17&rdquo;世界电信日照例是各大运营商推出各种优惠活动抢占市场的时机。与以往动辄三四千元的高端智能手机相比，今年的3G智能手机显然更加亲民，一些高端品牌也推出了更多实用的、符合运营商定制条件的手机。</p>\r\n<p>\r\n	<strong>　　豪赌千元智能机</strong></p>\r\n<p>\r\n	　　5月11日，中国联通和三星电子共同发布了千元智能机三星S6102E和S6352，裸机零售定价分别为1158元和1599元，并且能双卡双待。中国联通将为这两款联通定制手机提供存费送机和购机送费两种补贴模式，消费者可以享受到最高至0元购机的补贴优惠。</p>\r\n<p>\r\n	　　除了三星，诺基亚也联合中国电信共同推出国内首款WP7手机诺基亚800C。HTC的市场更为宽广，刚刚发布的新渴望系列与三大运营商同时合作，目前售价为1900元左右。</p>\r\n<p>\r\n	　　以上国际品牌&ldquo;乱入&rdquo;千元智能手机市场的意义在于，可能改变用户对千元智能手机 &ldquo;难在主流市场有所作为&rdquo;的看法。</p>\r\n<p>\r\n	　　另外的意义是，由于新机型上市给用户带来了更多高性价比的选择，一些高价位的手机价格也开始松动。最引人关注的莫过于中国电信iPhone4S 裸机价格直降500元，售价为4499元。同时，其他型号手机如诺基亚Lumia800C、华为C8850等降价幅度也在600~790元。</p>\r\n<p>\r\n	　　业内人士分析，高端品牌主要是受到苹果iPhone的挤压，市场关注度和份额都在不断下降。另一方面，与中国运营商的合作，利用运营商的渠道和补贴，既能扩大市场份额又能增加盈利。</p>\r\n<p>\r\n	　　毋庸置疑，手机品牌厂商之所以会在近期频繁推新机，还是受到市场需求的推动。爱立信近日发布的一份报告显示，中国智能手机普及率只有15%，但 32%的用户有更换智能手机的计划(周期为29个月)。根据工信部数据，未来两年内，全国对智能手机的需求量约2.78亿台。</p>\r\n<p>\r\n	　　目前中国智能手机只在一线城市得到普及，二、三线城市还并未被发掘。从天猫商城提供的数据来看，中低端价位的手机市场份额占76%，而3000元以上的手机仅为6%。</p>\r\n<p>\r\n	　　显然，千元智能机将会获得更多的青睐，国际品牌与国产品牌的正面竞争也将加快智能手机的普及。电信业专家项立刚认为，充分竞争给消费者带来了好处，但却使手机厂商陷入了困境，只有运营商更愿意去补贴低价位终端。</p>\r\n<p>\r\n	　　在这场智能手机的普及风暴中，最大的赢家莫过于芯片厂商和电信运营商。电信运营商对此更加喜闻乐见，电信设备的运营成本不断下降，用户数和资费也同时获益。</p>\r\n', 0, 0, '', '127.0.0.1', ''),
(14, 21, '.exe', '简体中文', '国产软件', '共享软件', 'Win2003,WinXP,Win2000,Win9X', 3, 'http://', 'http://', '0.02 MB', '{dede:link islocal=''1'' text=''本地下载''} /uploads/soft/201252315915.jpg {/dede:link}\r\n', '　　新京报讯 (记者 阳淼) 据知情人士透露，网易已经确定将进军智能手机行业，目前已经有试制机问世。该手机采用安卓4.0系统，预计售价在千元以下。\r\n<p>\r\n	<strong>　　丁磊称移动化对网易有利</strong></p>\r\n<p>\r\n	　　该接近网易高层的人士向新京报透露，网易的这款智能机系与知名手机制造商合作研发，采用4.3寸屏幕，双核CPU。与目前大部分安卓机预装安卓 2.3系列操作系统不同，网易手机直接预装最新的安卓4.0版操作系统，&ldquo;其特点是看视频的效果非常出色&rdquo;。网易创始人兼CEO丁磊对智能手机研发十分重 视，并直接确定了该手机1000元以下的价格政策。</p>\r\n<p>\r\n	　　论及该手机的出货时间，该人士表示目前仍然处于样机阶段，出货时间未定。</p>\r\n<p>\r\n	　　网易于昨日上午发布财报，财报显示，网易2012年第一季度总营收3.18亿美元，来自于网络游戏的收入占总收入的90%，达2.89亿美元。丁磊在财报发布后的电话会上对华尔街分析师表示，网易非常重视这一波智能手机在中国的普及所带来的机会。</p>\r\n<p>\r\n	　　丁磊表示，互联网从桌面向手机转移的趋势对网易的业务将有正面影响。谈及手机制造问题时，丁磊未正面回答，但表示&ldquo;我们在慎重考虑这个问题&rdquo;。</p>\r\n<p>\r\n	<strong>　　互联网公司扎堆千元手机</strong></p>\r\n<p>\r\n	　　在网易之前，互联网企业已经先后有数家尝试推出手机。其中，阿里巴巴与天语合作推出阿里云手机;雷军(微博)的小米公司推出小米手机;百度与戴 尔、长虹合作，推出两款百度云手机;360周鸿祎(微博)宣布将在下半年推出360定制手机;盛大则在秘密研发千元以下智能手机。</p>\r\n<p>\r\n	　　互联网企业介入手机制造，也大幅度拉低了手机的价格。小米手机本周发布了1499元的青春版小米，在双核1.2G、4寸屏幕的配置中占据最低价位置;百度与长虹推出的智能机、阿里云手机大黄蜂也在千元以下。360、网易和盛大手机的价格定位也基本在千元以下。</p>\r\n<p>\r\n	　　互联网资深分析人洪波认为，互联网公司进入手机制造领域，最明显的目的就是抢夺将来移动互联网入口。由于互联网公司均有比较充裕的现金流和稳定 的收入，因此敢于采用补贴、二次分成等方式抢占市场。创新工场CEO李开复(微博)却认为，单纯为了绑定自己的服务而推出手机，会限制用户的选择，不看好 大部分互联网企业进军手机业的前景。</p>\r\n<p>\r\n	　　■ 反应</p>\r\n<p>\r\n	<strong>　　&ldquo;地板价&rdquo;引质疑 周鸿祎称有补贴</strong></p>\r\n<p>\r\n	　　互联网企业进军手机业后大量推出千元以下手机。网易称推出的4.3寸屏幕，双核CPU的智能手机价格在1000元以下，引发质疑。有渠道人士称，从硬件配置看，目前各企业提出的手机方案很难降价至千元以下，因此这种报价可能有炒作嫌疑。</p>\r\n<p>\r\n	　　360董事长周鸿祎对此回复称，互联网公司做手机并不谋求从硬件中获取利润，而是着眼于扩大自身产品在移动互联网领域的用户基础，因此将会用流 量导引和电商渠道等优势进行&ldquo;补贴&rdquo;，由此降低手机本身的售价。&ldquo;360曾经用免费模式颠覆了杀毒行业，手机行业其实也可以免费。只不过硬件的免费并不意 味着0元价格，因为有本身的成本在那儿，但手机行业以成本价购机这种&lsquo;免费&rsquo;应该能实现&rdquo;。(阳淼)</p>\r\n', 0, 0, '', '127.0.0.1', ''),
(15, 21, '.exe', '简体中文', '国产软件', '共享软件', 'Win2003,WinXP,Win2000,Win9X', 3, 'http://', 'http://', '0.03 MB', '{dede:link islocal=''1'' text=''本地下载''} /uploads/soft/201252315829.jpg {/dede:link}\r\n', '<div class="maincontent clearfix">\r\n	<div class="maincontent clearfix" id="MainContent">\r\n		<p>\r\n			　　华为终端首款旗舰级轻薄双核智能手机Ascend P1，在4月18日首发当日即被抢购一空，引发了业内与媒体的高度关注。随后，该款机型在公开市场强势突破，短短10日内便覆盖苏宁等大型3C渠道、手机 专营店以及品牌专营店。截止至5月15日，华为Ascend P1已在500家Top零售店面完成铺货上柜，并在一线重点城市的30余家专营店销售告罄，出现一机难求的热销局面。</p>\r\n		<p>\r\n			　　华为Ascend P1的广受好评，源于其工业设计与硬件配置、应用体验的综合实力。早在CES展首次与大众见面时，华为Ascend P1就引起了媒体和数码发烧友的热力追捧。全球首发当日，伴随&ldquo;2999元&rdquo;这一极具竞争力的零售价格公布，消费者关注一度爆棚。Ascend P1定位于轻薄时尚的高端智能机，其核心产品优势在于&ldquo;极致&rdquo;惊艳的工业设计。7.69mm极致纤薄机身、64.8mm黄金宽度以及110g机身重量，为 用户带来极致舒适握感。同时华为Ascend P1采用了主频1.5GHz的德州仪器OMAP 4460处理器，在双核智能手机中运行速度最快。</p>\r\n		<p>\r\n			　　华为Ascend P1的热销，更多来源于精准的市场策略支撑。如今的高端智能机市场，苹果在华智能手机市场份额已经被挤出前三，HTC、索尼等智能手机厂商利润下滑，高端 市场出货量萎缩。华为终端瞄准契机，针对P1采用了高竞争性定价策略，速赢得了市场认同。其次，华为终端手机销售渠道同样进行了巨大变革：一改单一的运营 商定制渠道，全面拓展公开社会渠道，覆盖全国大型3C卖场，强化品牌专营店建设，并在电子商务渠道等销售业态上进行了创新尝试。快速而精准的渠道布局和产 品定价策略，使华为终端成功跻身全球顶级智能手机俱乐部。</p>\r\n		<p>\r\n			　　</p>\r\n		<div align="center">\r\n			<img alt="1" height="327" src="/uploads/allimg/130304/0Z31340Q-0.jpg" width="493" /></div>\r\n		<p>\r\n			&nbsp;</p>\r\n		<p>\r\n			　　无论是&ldquo;向情感致敬&rdquo;的工艺设计修养、还是手机智能时代的生活理念，华为Ascend P1都深刻代表着智能手机的消费趋势和发展方向。华为Ascend P1的热销将有助于推动顶级智能手机行业的洗牌，加速智能手机顶级厂商格局的调整。</p>\r\n	</div>\r\n</div>\r\n', 0, 0, '', '127.0.0.1', ''),
(16, 21, '.exe', '简体中文', '国产软件', '共享软件', 'Win2003,WinXP,Win2000,Win9X', 3, 'http://', 'http://', '0.02 MB', '{dede:link islocal=''1'' text=''本地下载''} /uploads/soft/201252315915.jpg {/dede:link}\r\n', '　微软必应宣布了大改版以后，Google也不甘寂寞。昨天Google在其官方博客上公布了最新搜索功能知识图谱(Knowledge Graph)。Google在搜索页面右侧增加了大篇幅的更明确的搜索结果，改变了以往以文字为主的搜索结果条目呈现方式，可能是Google搜索上线以 来最重大的一次变革。\r\n<p>\r\n	　　</p>\r\n<div align="center">\r\n	<img alt="Google推出知识图谱 搜索模式迎来大变革" height="0" src="/uploads/allimg/130304/0Z3432V5-0.jpg" width="0" /></div>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	　　Google此前的搜索方式以文字为主，默认每页显示十个搜索条目，虽然含有链接、图片及页面预览等元素，但仍然需要用户仔细阅读页面以判断。而新上线的知识图谱则有了更丰富直观的内容，它集成于搜索页的右栏，可为用户提供地图、维基百科条目等各种各样的知识。</p>\r\n<p>\r\n	　　知识图谱无疑能为人们带来很大的便利。比如说，用户搜索&ldquo;taj mahal&rdquo;(泰姬陵)的时候，Google图谱会为你显示泰姬陵的地图位置、维基百科介绍、建筑相关知识(高度、开放时间、设计师等)，还会给出和 taj mahal同名的人物及赌场等信息，对比原先以文字为主的搜索结果呈现方式，极大程度地提升了用户体验。</p>\r\n<p>\r\n	　　</p>\r\n<div align="center">\r\n	<img alt="Google推出知识图谱 搜索模式迎来大变革" height="0" src="/uploads/allimg/130304/0Z3431238-1.jpg" width="0" /></div>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	　　知识图谱背后有着强大的知识库支持。Google在2010年收购了Metaweb，这是一家专注于研究信息之间如何彼此联系的公司，最终可以 提供比关键词更高效的搜索算法。Google使用Metaweb的技术，以Freebase、维基百科、CIA World Factbook等公共资源及自身搜索的信息作为数据库，知识图谱可涵盖方方面面。</p>\r\n<p>\r\n	　　</p>\r\n<div align="center">\r\n	<img alt="Google知识图库将会在本周于美国地区上线，不过在初期只支持英语。但Google一直是一个推进迅速的公司，相信这项革新不久就会普及全球，大家拭目以待吧。" height="0" src="/uploads/allimg/130304/0Z3433445-2.jpg" width="0" /></div>\r\n<p>\r\n	&nbsp;</p>\r\n<p>\r\n	　　Google知识图库将会在本周于美国地区上线，不过在初期只支持英语。但Google一直是一个推进迅速的公司，相信这项革新不久就会普及全球，大家拭目以待吧。</p>\r\n', 0, 0, '', '127.0.0.1', '');
