(29, 19, '0', 1362361553, '', 1, 1, -2, 197, 0, '强化多功能应用 手机银行进入普及期', '', '', 'admin', '未知', '', 1362361553, 1362361593, 1, '强化,多功能,应用,手机,银行,进入,普及,期,', 0, 0, 0, 0, 0, 0, '在手机上输入银行网址，或下载某银行的客户端，联网上线，打开进入银行界面，登录自己的银行账户，就可以查询账户往来明细，进行各项金融个人业务这不就是手机银行么? 是的，', '', 1, 0, 0, 28),
(30, 19, '0', 1362361603, '', 1, 1, -2, 168, 0, '法院成功追诉生产假冒诺基亚手机幕后老板', '', '', 'admin', '未知', '', 1362361603, 1362361613, 1, '法院,成功,追诉,生产,假冒,诺基亚,手机,幕后,', 0, 0, 0, 0, 0, 0, '5月17日讯(记者 梁沅 通讯员 刘芳 何亮)记者17日获悉，在三打两建专项行动中，龙岗区法院以假冒注册商标罪成功将一起涉案金额高达140万的假冒诺基亚注册商标案的幕后老板许某光追', '', 1, 0, 0, 29),
