INSERT INTO `dede_arctype` (`id`, `reid`, `topid`, `sortrank`, `typename`, `typedir`, `isdefault`, `defaultname`, `issend`, `channeltype`, `maxpage`, `ispart`, `corank`, `tempindex`, `templist`, `temparticle`, `namerule`, `namerule2`, `modname`, `description`, `keywords`, `seotitle`, `moresite`, `sitepath`, `siteurl`, `ishidden`, `cross`, `crossid`, `content`, `smalltypes`) VALUES
(1, 0, 0, 1, '中文网站', '{cmspath}/cn', 1, 'index.html', 1, 1, -1, 1, 0, '{style}/index.htm', '{style}/list_article.htm', '{style}/article_article.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', 0, '', '', 0, 0, '', '', ''),
(2, 1, 1, 2, '关于公司', '{cmspath}/cn/about', 1, 'index.html', 1, 1, -1, 0, 0, '{style}/index_article.htm', '{style}/jianjie.htm', '{style}/jianjie.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', 0, '', '', 0, 0, '', '<img alt="" oldblock="inline" src="/templets/default/images/2012521212111.jpg" style="border: 0px solid; background-color: rgb(252, 252, 252); height: 186px; float: left; color: rgb(51, 51, 51); padding: 0px; line-height: 36px; font-family: 宋体; margin: 0px 21px 5px 0px; display: inline; width: 250px; text-indent: 24px; " /><font size="2" style="background-color: rgb(252, 252, 252); font-family: 宋体; color: rgb(51, 51, 51); line-height: 36px; text-indent: 24px; ">&nbsp; &nbsp;&nbsp;</font><span style="color: rgb(0, 0, 0); font-family: &quot;times new roman&quot;, times, serif; font-size: 22px;">河南省商开智能科技股份有限是一家专业从事高低压开关设备、智能无功补偿电容器、智能配电终端及系统集成设备等；集贸易、技术、服务于一体的系统集成、产品销售、工程服务的高新技术企业。</span><br style="color: rgb(0, 0, 0); font-family: &quot;times new roman&quot;, times, serif; font-size: 22px;" />\r\n<span style="color: rgb(0, 0, 0); font-family: &quot;times new roman&quot;, times, serif; font-size: 22px;">&nbsp; &nbsp; &nbsp; &nbsp;公司集全国知名电力智能化专家技术实力于一身，以引领电力智能化产业技术为己任，推动我国电力智能化事业的快速发展。企业拥有多项自主知识产权和专利技术，多年来的生产经验、雄厚的技术力量，高素质的员工队伍，确保产品质量稳定、安全。公司自成立以来，一直坚持以客户为中心，以诚信对待每位客户。</span><br style="color: rgb(0, 0, 0); font-family: &quot;times new roman&quot;, times, serif; font-size: 22px;" />\r\n<span style="color: rgb(0, 0, 0); font-family: &quot;times new roman&quot;, times, serif; font-size: 22px;">&nbsp; &nbsp; &nbsp; &nbsp;我公司的产品以其良好的性能质量、完善的售后服务，得到了用户的一致好评，在汽车、食品、纺织机械、化工、电力、建筑、水利、煤焦化工、污水处理、 电厂水厂、印刷等行业中建立了良好的信誉。 公司将秉承&quot;诚信、专业、发展、共赢&quot;的经营理念，&ldquo;服务、创新、团结、务实&rdquo;的经营宗旨。不断开拓新市场、承接新业务，公司以先进的科学技术为龙头，严密的企业管理为依托，为客户提供严谨而周密的服务，树立公司良好的企业形象和打造公司优良的服务品牌。</span><br style="color: rgb(0, 0, 0); font-family: &quot;times new roman&quot;, times, serif; font-size: 22px;" />\r\n<span style="color: rgb(0, 0, 0); font-family: &quot;times new roman&quot;, times, serif; font-size: 22px;">&nbsp; &nbsp; &nbsp; &nbsp;热忱欢迎国内外各界朋友和新老客户莅临指导、洽谈合作。</span>', ''),
(3, 1, 1, 3, '产品与技术', '{cmspath}/cn/product', 1, 'index.html', 1, 6, -1, 0, 0, '{style}/index_shop.htm', '{style}/list_cp.htm', '{style}/article_cp.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', 0, '', '', 0, 0, '', '<div style="text-align: center; ">\r\n	&nbsp;</div>\r\n<table cellpadding="0" cellspacing="0" width="710">\r\n	<tbody>\r\n		<tr>\r\n			<td style="text-align: center; ">\r\n				<img alt="公司场景" border="0" height="188" src="/uploads/allimg/140426/1G4225033-0.jpg" width="250" /></td>\r\n			<td style="text-align: center; ">\r\n				<img alt="公司场景1" border="0" height="188" src="/uploads/allimg/140426/1G4221241-1.jpg" width="250" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align: center; ">\r\n				公司场景一</td>\r\n			<td style="text-align: center; ">\r\n				&nbsp;公司场景二</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align: center; ">\r\n				<img alt="除尘骨架" border="0" height="188" src="/uploads/allimg/140426/1G4223U2-2.jpg" width="250" /></td>\r\n			<td style="text-align: center; ">\r\n				<img alt="布袋生产场景" border="0" height="188" src="/uploads/allimg/140426/1G4222022-3.jpg" width="250" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align: center; ">\r\n				&nbsp;除尘骨架</td>\r\n			<td style="text-align: center; ">\r\n				&nbsp;布袋生产场景</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align: center; ">\r\n				<img alt="产品装运" src="/uploads/allimg/140426/1G42252U-4.jpg" style="border-width: 0px; border-style: solid; width: 250px; height: 188px; " /></td>\r\n			<td style="text-align: center; ">\r\n				<img alt="骨架制造" src="/uploads/allimg/140426/1G42233L-5.jpg" style="border-width: 0px; border-style: solid; width: 250px; height: 188px; " /></td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align: center; ">\r\n				&nbsp;产品装运</td>\r\n			<td style="text-align: center; ">\r\n				&nbsp;骨架制造</td>\r\n		</tr>\r\n		<tr>\r\n			<td style="text-align: center; ">\r\n				<img alt="骨架成品展示" border="0" height="180" src="/uploads/allimg/1404