(4, 1, 1, 4, '新闻资讯', '{cmspath}/cn/news', 1, 'index.html', 1, 1, -1, 0, 0, '{style}/index_article.htm', '{style}/list_news.htm', '{style}/article_news.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '提供，牌艺行业文化，牌技行业文化，牌技行业心得，三大领域最新信息新闻，我们的文化着力于千术绝技的研发与创新！我们的理念竭力于您的赢利为您的赢利为核心！', '牌艺行业文化，牌技行业文化，牌技行业心得', '牌艺行业文化，牌技行业文化，牌技行业心得', 0, '', '', 0, 0, '', '&nbsp;', ''),
(7, 1, 1, 9, '联系方式', '{cmspath}/cn/contact', 1, 'index.html', 1, 1, -1, 0, 0, '{style}/index_article.htm', '{style}/lianxi.htm', '{style}/lianxi.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', 0, '', '', 0, 0, '', '<table border="0" cellpadding="1" cellspacing="1" style="line-height: 25px; color: rgb(116, 116, 116); font-family: Simsun; " width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td style="font-family: Arial, Helvetica, sans-serif; padding-left: 50px; ">\r\n				<p style="list-style: none; margin: 0px; padding: 0px 5px; ">\r\n					<span style="color:#000000;"><span style="font-size:16px;">河南省商开智能科技股份有限公司</span></span><br />\r\n					<br />\r\n					<span style="color: rgb(0, 0, 0); "><span style="font-size: 14px; ">&nbsp;联系人：李凤亚<br />\r\n					&nbsp;固&nbsp;&nbsp;话：</span></span><span style="color: rgb(0, 0, 0); font-size: 14px;">0370</span><span style="color: rgb(0, 0, 0); font-size: 14px;">-3250685</span><br />\r\n					<span style="color: rgb(0, 0, 0); "><span style="font-size: 14px; ">&nbsp;传&nbsp;&nbsp;真：0370-3250685<br />\r\n					&nbsp;邮&nbsp;&nbsp;编：056300</span></span></p>\r\n				<p style="list-style: none; margin: 0px; padding: 0px 5px;">\r\n					<span style="color: rgb(0, 0, 0); "><span style="font-size: 14px; ">&nbsp;邮&nbsp;&nbsp;箱：</span></span><span style="color:#000000;"><span style="font-size:14px;">alfengya</span></span><span style="font-size: 14px; "><span style="text-decoration: none; color: rgb(0, 0, 0);"><a href="mailto:843197782@qq.com" style="text-decoration: none; color: rgb(51, 51, 51); ">@163.com</a></span></span></p>\r\n				<p style="list-style: none; margin: 0px; padding: 0px 5px; ">\r\n					<span style="font-size: 14px; "><span style="color: rgb(0, 0, 0); ">&nbsp;地&nbsp;&nbsp;址：</span></span><span style="color:#000000;"><span style="font-size:14px;">河南省商丘市睢阳区产业集聚区&nbsp;</span></span></p>\r\n			</td>\r\n			<td style="font-family: Arial, Helvetica, sans-serif; ">\r\n				<p style="list-style: none; margin: 0px; padding: 0px 5px; ">\r\n					<img alt="" src="/uploads/allimg/140426/1-140426152U4502.jpg" style="border: 0px none; height: 461px; float: right; width: 351px; " /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<br />\r\n', ''),
(18, 4, 1, 50, '企业动态', '{cmspath}/cn/news/CompanyNews', 1, 'index.html', 1, 1, -1, 0, 0, '{style}/index_article.htm', '{style}/list_news.htm', '{style}/article_news.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', 0, '', '', 0, 0, '', '&nbsp;', ''),
(19, 4, 1, 50, '行业新闻', '{cmspath}/cn/news/IndustryNews', 1, 'index.html', 1, 1, -1, 0, 0, '{style}/index_article.htm', '{style}/list_news.htm', '{style}/article_news.htm', '{typedir}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', 0, '', '', 0, 0, '', '', ''),
(66, 2, 1, 22, '企业简介', '{cmspath}/cn/about/qiyejianjie', 1, 'index.html', 1, 1, -1, 0, 0, '{style}/index_article.htm', '{style}/jianjie.htm', '{style}/jianjie.htm', '{typedir}/{Y}/{M}{D}/{aid}.html', '{typedir}/list_{tid}_{page}.html', 'default', '', '', '', 0, '', '', 0, 0, '', '<span style="font-family:times new roman,times,serif;"><span style="font-size:22px;">&nbsp; &nbsp; &nbsp; &nbsp; 河南省商开智能科技股份有限是一家专业从事高低压开关设备、智能无功补偿电容器、智能配电终端及系统集成设备等；集贸易、技术、服务于一体的系统集成、产品销售、工程服务的高新技术企业。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;公司集全国知名电力智能化专家技术实力于一身，以引领电力智能化产业技术为己任，推动我国电力智能化事业的快速发展。企业拥有多项自主知识产权和专利技术，多年来的生产经验、雄厚的技术力量，高素质的员工队伍，确保产品质量稳定、安全。公司自成立以来，一直坚持以客户为中心，以诚信对待每位客户。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;我公司的产品以其良好的性能质量、完善的售后服务，得到了用户的一致好评，在汽车、食品、纺织机械、化工、电力、建筑、水利、煤焦化工、污水处理、 电厂水厂、印刷等行业中建立了良好的信誉。 公司将秉承&quot;诚信、专业、发展、共赢&quot;的经营理念，&ldquo;服务、创新、团结、务实&rdquo;的经营宗旨。不断开拓新市场、承接新业务，公司以先进的科学技术为龙头，严密的企业管理为依托，为客户提供严谨而周密的服务，树立公司良好的企业形象和打造公司优良的服务品牌。<br />\r\n&nbsp; &nbsp; &nbsp; &nbsp;热忱欢迎国内外各界朋友和新老客户莅临指导、洽谈合作。</span></span><br />\r\n<img alt="" src="/uploads/allimg/180427/1-1P42G01KL11.jpg" style="font-size: 26px; width: 344px; height: 344px;" />', '');
